// SPDX-License-Identifier: MIT
pragma solidity 0.8.9;

/**
 * @title NotarizationStaking
 * @dev Smart contract for managing staking in the Hedera Content Notarization Platform
 * Users stake HBAR before notarization, funds are held until service completion
 */
contract NotarizationStaking {

    // Contract admin (deployer)
    address payable public admin;

    // Application owner account that receives successful stakes
    address payable public appAccount;

    // Minimum stake amount required (in tinybars, 1 HBAR = 100,000,000 tinybars)
    uint256 public minimumStake;

    // Maximum time allowed for service completion (in seconds)
    uint256 public serviceTimeout;

    // Struct to store stake information
    struct Stake {
        address payable user;
        uint256 amount;
        uint256 timestamp;
        string requestId; // Unique identifier for the notarization request
        StakeStatus status;
    }

    enum StakeStatus {
        PENDING,    // Stake created, service not yet completed
        COMPLETED,  // Service completed successfully, funds transferred to app
        REFUNDED,   // Stake refunded to user due to failure/timeout
        EXPIRED     // Stake expired, available for refund
    }

    // Mapping from request ID to stake information
    mapping(string => Stake) public stakes;

    // Array to keep track of all request IDs
    string[] public requestIds;

    // Events
    event StakeCreated(string indexed requestId, address indexed user, uint256 amount);
    event StakeCompleted(string indexed requestId, address indexed user, uint256 amount);
    event StakeRefunded(string indexed requestId, address indexed user, uint256 amount);
    event StakeExpired(string indexed requestId, address indexed user, uint256 amount);
    event AppAccountUpdated(address indexed newAppAccount);

    // Modifiers
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier onlyAppAccount() {
        require(msg.sender == appAccount, "Only app account can perform this action");
        _;
    }

    modifier validStake(string memory requestId) {
        require(stakes[requestId].user != address(0), "Stake does not exist");
        _;
    }

    constructor() {
        admin = payable(msg.sender); // Set deployer as admin
        minimumStake = 50000000; // Default: 0.5 HBAR
        serviceTimeout = 3600; // Default: 1 hour
        // appAccount will be set by admin after deployment
    }

    /**
     * @dev Initialize the app account (called once after deployment)
     * @param _appAccount The destination account for successful stakes
     */
    function initializeAppAccount(address _appAccount) external onlyAdmin {
        require(appAccount == address(0), "App account already initialized");
        require(_appAccount != address(0), "Invalid app account");
        appAccount = payable(_appAccount);
        emit AppAccountUpdated(_appAccount);
    }

    /**
     * @dev Create a new stake for notarization service
     * @param requestId Unique identifier for the notarization request
     */
    function createStake(string memory requestId) external payable {
        require(msg.value >= minimumStake, "Insufficient stake amount");
        require(stakes[requestId].user == address(0), "Request ID already exists");
        require(bytes(requestId).length > 0, "Request ID cannot be empty");

        stakes[requestId] = Stake({
            user: payable(msg.sender),
            amount: msg.value,
            timestamp: block.timestamp,
            requestId: requestId,
            status: StakeStatus.PENDING
        });

        requestIds.push(requestId);

        emit StakeCreated(requestId, msg.sender, msg.value);
    }

    /**
     * @dev Complete a stake after successful service delivery
     * @param requestId The request ID to complete
     * Can only be called by the app account
     */
    function completeStake(string memory requestId) external onlyAppAccount validStake(requestId) {
        Stake storage stake = stakes[requestId];
        require(stake.status == StakeStatus.PENDING, "Stake is not pending");

        stake.status = StakeStatus.COMPLETED;

        // Transfer staked amount to app account
        appAccount.transfer(stake.amount);

        emit StakeCompleted(requestId, stake.user, stake.amount);
    }

    /**
     * @dev Refund a stake due to service failure or technical glitch
     * @param requestId The request ID to refund
     * Can only be called by the app account
     */
    function refundStake(string memory requestId) external onlyAppAccount validStake(requestId) {
        Stake storage stake = stakes[requestId];
        require(stake.status == StakeStatus.PENDING, "Stake is not pending");

        stake.status = StakeStatus.REFUNDED;

        // Refund staked amount to user
        stake.user.transfer(stake.amount);

        emit StakeRefunded(requestId, stake.user, stake.amount);
    }

    /**
     * @dev Allow users to claim refund for expired stakes
     * @param requestId The request ID to claim refund for
     */
    function claimExpiredRefund(string memory requestId) external validStake(requestId) {
        Stake storage stake = stakes[requestId];
        require(stake.user == msg.sender, "Only stake owner can claim refund");
        require(stake.status == StakeStatus.PENDING, "Stake is not pending");
        require(block.timestamp >= stake.timestamp + serviceTimeout, "Stake has not expired yet");

        stake.status = StakeStatus.EXPIRED;

        // Refund expired stake to user
        stake.user.transfer(stake.amount);

        emit StakeExpired(requestId, stake.user, stake.amount);
    }

    /**
     * @dev Get stake information for a request
     * @param requestId The request ID to query
     * @return user The user who created the stake
     * @return amount The staked amount
     * @return timestamp When the stake was created
     * @return status Current status of the stake
     */
    function getStake(string memory requestId) external view returns (
        address user,
        uint256 amount,
        uint256 timestamp,
        StakeStatus status
    ) {
        Stake storage stake = stakes[requestId];
        require(stake.user != address(0), "Stake does not exist");

        return (stake.user, stake.amount, stake.timestamp, stake.status);
    }

    /**
     * @dev Check if a stake is expired and eligible for refund
     * @param requestId The request ID to check
     * @return isExpired True if the stake is expired
     */
    function isStakeExpired(string memory requestId) external view returns (bool isExpired) {
        Stake storage stake = stakes[requestId];
        require(stake.user != address(0), "Stake does not exist");

        return (stake.status == StakeStatus.PENDING && block.timestamp >= stake.timestamp + serviceTimeout);
    }

    /**
     * @dev Get total number of stakes
     * @return count Total number of stakes created
     */
    function getTotalStakes() external view returns (uint256 count) {
        return requestIds.length;
    }

    /**
     * @dev Get contract balance
     * @return balance Current contract balance in tinybars
     */
    function getContractBalance() external view returns (uint256 balance) {
        return address(this).balance;
    }

    /**
     * @dev Update minimum stake amount (only app account)
     * @param newMinimumStake New minimum stake amount in tinybars
     */
    function updateMinimumStake(uint256 newMinimumStake) external onlyAppAccount {
        minimumStake = newMinimumStake;
    }

    /**
     * @dev Update service timeout (only app account)
     * @param newServiceTimeout New service timeout in seconds
     */
    function updateServiceTimeout(uint256 newServiceTimeout) external onlyAppAccount {
        serviceTimeout = newServiceTimeout;
    }

    /**
     * @dev Emergency function to pause contract (only app account)
     * In case of critical issues, prevents new stakes
     */
    bool public contractPaused = false;

    function pauseContract() external onlyAppAccount {
        contractPaused = true;
    }

    function unpauseContract() external onlyAppAccount {
        contractPaused = false;
    }

    modifier whenNotPaused() {
        require(!contractPaused, "Contract is paused");
        _;
    }

    // Add pause check to createStake function
    function createStakeSecure(string memory requestId) external payable whenNotPaused {
        require(msg.value >= minimumStake, "Insufficient stake amount");
        require(stakes[requestId].user == address(0), "Request ID already exists");
        require(bytes(requestId).length > 0, "Request ID cannot be empty");

        stakes[requestId] = Stake({
            user: payable(msg.sender),
            amount: msg.value,
            timestamp: block.timestamp,
            requestId: requestId,
            status: StakeStatus.PENDING
        });

        requestIds.push(requestId);

        emit StakeCreated(requestId, msg.sender, msg.value);
    }
}

